    const fetchData = async () =>
      (await fetch("https://jsonplaceholder.typicode.com/todos")).json();

    fetchData().then((data) => {
      for (let item of data) {
        toAppend.innerHTML += `
<div class="card">
<p>${item.id}</p>
<h2>${item.title}</h2>
</div>
`;
      }
    });
  }

  fetch("https://dummyjson.com/products")
    .then((res) => res.json())
    .then((data) => console.log(data.json()));

